import Navbar from './components/Navbar';
import './App.css';
import React from 'react';
import { Route, Router, Routes } from 'react-router-dom';
function App() {
  return (
      <>
      <Router>
      <Navbar />
        <Routes>
          <Route path='/' exact />
        </Routes>
      </Router>
      </> 
  );
}

export default App;
